(92, 92, 'Pwede bang malaman ang iyong dahilan?\nBiglaan mong paglisan, \'di napaghandaan\nHindi sana nasaktan at naguguluhan\nNasa\'n ang pag-ibig na aking inaasam? Yeah\nInakala na makakasama ka\nHanggang sa dulo\'y \'di mawawala\n\'Di na sana naniwala sa iyong mga salita na tila nag-iba\n\nSa umiikot kong isip sa gabi\nYakap aking unan na tanging katabi\nInaasam ang pag-ibig na para sa akin\n\n\'Di na nasundan ang kabanata natin\nKahit ilang beses pang ulit-ulitin\nMga alaala nating dalawa\'y pinipilit ko pa ring limutin\nKahit na sa gabi ay pumapatak ang luha\nSa umaga\'y napapatulala, halo-halong emosyon\nHinahanap ang rason, kung bakit bigla kang nawala\nHindi ko inakala na, \'di ko na muling mahahawakan pa\nAng iyong kamay na sa\'kin ay binibigay\nKapag ako\'y nalulumbay\nAt \'di na sana umasa sa mga pangako mo sa\'kin\nMga pangako natin ating pag-ibig na dapat hindi nawala\n\nSa umiikot kong isip sa gabi\nYakap aking unan na tanging katabi\nInaasam ang pag-ibig na para sa akin\n\nSana\'y hindi na lang kita nakilala\nSana\'y mabura lahat ng alaala\nDahil sa tuwing naiisip kita, ako\'y naluluha\nSana\'y hindi na lang kita nakilala\nSana\'y mabura lahat ng alaala\nDahil sa tuwing naiisip kita, ako\'y naluluha\nAh, ah, ah, ah\n\nSa umiikot kong isip sa gabi\nYakap aking unan na tanging katabi\nInaasam ang pag-ibig na para sa akin', 1, 1, 1, '2024-10-25 06:01:05', '2024-11-02 04:58:23', 'tl'),
