(373, 373, '@verse 1\nPauwi na nang makita\'ng mga rosas\n(Salubong sa ngiti niya)\nAle, akin na\'t ubos na\'ng aking oras\n(Ako\'y hinihintay na niya)\nPara, para, pasakay na sa jeep, kuya\nNais ko na siyang makita\n\n@chorus\nOh ulan, nawa\'y tumila lalo na sa Marikina\nSusulungin ko kahit ilang bagyo\nMabigay ko lang ang mga rosas sa iyo (sa iyo)\n\n@verse 2\nMama, para, teka, ako\'y bababa na\n(Diyan na lang sa may simbahan)\nPanalangin ko\'y makuha ang loob niya\n(Ito\'ng aking nadarama)\nSabik masilayan ang kanyang kagandahan\nSabay hahalik sa labi niya\n\nchorus\nOh ulan, nawa\'y tumila lalo na sa Marikina\nSusulungin ko kahit ilang bagyo\nMabigay ko lang ang mga rosas sa iyo (sa iyo)\n\n@instrumental\n\n@chorus\nOh ulan, nawa\'y tumila lalo na sa Marikina\nSusulungin ko kahit ilang bagyo\nMabigay ko lang ang mga rosas sa iyo\n\n@chorus\nOh ulan, nawa\'y tumila lalo na sa Marikina\nSusulungin ko kahit ilang bagyo\nMabigay ko lang ang mga rosas sa iyo', 1, 1, 1, '2024-10-25 06:01:05', '2024-11-02 04:58:23', NULL),
