(575, 575, '@verse\nKaya namang makayanan\nKahit pa na nahihirapan\nKahit lungkot, dumaraan\n\'Pag natuyo na ang luha\n\n@pre-chorus\nParang nahipan\nAng \'yong kandila\nInit ay wala\n\n@chorus\nHindi ba, pangako mo no\'ng una, tiwala\'y iingatan?\nBaka naman, sa susunod na habang-buhay, ha-ay, na lang\n\n@verse\n\'Di talaga inasahang\nMagkagulo\'t magkagulatan\nTahanang pinagpaguran\nSa\'n na napunta?\n\n@chorus\nHindi ba, pangako mo no\'ng una, tiwala\'y iingatan?\nBaka naman, sa susunod na habang-buhay, ha-ay\n\n@instrumental\n\n@chorus\nHindi ba, pangako mo no\'ng una, tiwala\'y iingatan?\nBaka naman, sa susunod na habang-buhay, ha-ay\nAt kahit nabago na ng oras, ang puso ma\'y nabutas\nIkaw pa rin sa susunod na habang-buhay, ha-ay, ha-ay\n\n@outro\nIkaw pa rin ang pipiliin kong mahalin\nSa susunod na habang-buhay', 1, 1, 1, '2024-10-25 06:01:05', '2024-11-19 19:34:08', 'tl'),
