(590, 590, '@verse\nKahapon sa paglalakad natisod na naman\nNg kastilyong buhanging kung sa\'n\nGumuho ang pinagsamahan\nNakikita sa hampas ng mga alon ay ikaw pa rin\n\n@chorus\nPakiusap na lumayas ka sa \'king isipan\nNang umahon na ang puso sa dalampasigan mo\n\n@verse\nDumampi sa \'king pisngi ang init ng araw\nPinawi kahit sandali damdamin kong giniginaw\nNakikita sa hampas ng mga alon ay ikaw pa rin\n\n@chorus\nPakiusap na lumayas ka sa \'king isipan\nNang umahon na ang puso sa dalampasigan\n\n@bridge\nIiwas na kung maaari na para bang walang nangyari\nAyoko nang magpatali sa \'yo\n\n@chorus\nPakiusap na lumayas ka sa \'king isipan\nNang umahon na ang puso sa dalampasigan\nPakiusap na hayaan mo na \'kong umusad\nNang umahon na ang puso sa dalampasigan mo huh hu', 1, 1, 1, '2024-10-25 06:01:05', '2024-11-02 04:58:23', NULL),
