(592, 582, '@verse\nKulang pa yata\'ng 24 oras sa \'kin\nSa mga problema kong mas marami pa sa mga bituin\nAyoko namang magpatalo, pero\nBa\'t parang ubos na ubos na ako?\n\n@chorus\nAng sabi mo, \"Dito ka lang sa \'kin\nMagpahinga muna, lalabanan din\nMga dambuhalang \'di maubos na problema\nMalapit na, pero \'di rin kasalanang magpahinga\"\n\n@verse\nKulang pa yata\'ng \'sandaang taon, ba\'t nakakulong pa rin?\n\'Di ko na ba maaabutan lahat ng mga gusto kong gawin?\nAyoko namang magpatalo, pero\nSiguro pagod na pagod lang ako\n\n@chorus\nAng sabi mo, \"Dito ka lang sa \'kin\nMagpahinga muna, lalabanan din\nMga dambuhalang \'di maubos na problema\nMalapit na, pero \'di rin kasalanang magpahinga\"\n\n@bridge\nMagpahinga ka lang muna\n\'Wag nang pigilan ang luha\n\n@chorus\nDito ka lang sa \'kin\nMagpahinga muna, lalabanan din\nMga dambuhalang mga pasanin\nLapag mo lang muna, kakayanin din\nKumapit ka, sinta, matatapos ang problema\nMalapit na, pero \'di rin kasalanang magpahinga', 1, 1, 1, '2024-10-25 06:01:05', '2024-11-20 15:35:41', 'tl'),
