(602, 593, '@verse 1\nNalulunod sa pangangamba\nPuno na ang baga, pasuko ka na\nSa\'n ka kakapit kung malalim na?\nAng sabi ay \"Arte lang \'yan\" (oh-oh-oh-oh)\n\n@verse 2\nNalulunod sa pangangamba\n\'Di mo alam kung may pangtustos pa\nNagkaubusan na ng pangmedisina\nAng sabi\'y \"Bahala ka na\"\n\n@chorus\nAng pagkakalunod\nAy nararanasan mo na ba?\nSana\'y makaahon ka\n\'Pagkat kailangan ka nila\n\n@verse 3\nNalulunod sa pangangamba\nMga parusang \'di humuhupa\nSa\'n ka kakapit kung malalim na?\nAng sabi\'y \"Mababaw lang \'yan\"\n\n@chorus\nAng pagkakalunod\nAy nararanasan ng iba\nSana\'y makaahon ka\n\'Pagkat kailangan ka nila\nHmm, hmm, hmm, hmm\n\n@chorus\nNalulunod sa pangangamba\nDahan-dahan, ako\'y lalangoy na\nOoh, sisisirin hanggang makarating ka\nSa ginhawang itinadhana\nSa ginhawang itinadhana\n\n@outro\n\'Di na muling malulunod pa', 1, 1, 1, '2024-10-25 06:01:05', '2024-11-02 04:58:23', NULL),
