(624, 624, '@verse\nIsang gabi noong nagkita tayo\nNatatandaan ko pa, malapit no\'ng mag-Pasko\nSumisilip, sumusulyap lang sa tingin mo\nNa singkinang ng mga talang nakikita ko\n\n@pre-chorus\nAno pa nga ba ang magagawa ko\nKung hanggang tingin na lang ako sa \'yo?\n\n@chorus\nKapag humihingi ako sa \'yo ng pansin\nSana man lang kasi, iyong lingunin\nKahit isang kaway lang naman ng iyong kamay\nKasabay ng \'yong tingin at ng iyong...\nIsang \"Hi\"\n\n@verse\nLimang gabi na tayong nagkikita (limang gabi na tayo)\nNagtatanong sa isip, \"Ano\'ng pangalan n\'ya?\"\nBuhat sa mga ngiti mong \'di mawala-wala\nKaya ngayong Simbang Gabi, hiling ko\'y himala\n\n@pre-chorus\nAno pa nga ba ang magagawa ko\nKung hanggang ngiti na lang ako sa \'yo?\n\n@chorus\nKapag humihingi ako sa \'yo ng pansin\nSana man lang kasi, ika\'y tumingin\nKahit isang kaway lang naman ng iyong kamay\nKasabay ng \'yong tingin at ng iyong...\nIsang \"Hi\"\n\n@verse\nNgayong gabi na ang Misa de Gallo\nAlam ko nang hindi na tayo magtatagpo\nAt kung hindi ko man masabi ang nasa puso ko\nIbubulong na lang ito sa sarili ko, whoa\n\n@chorus\nAno pa nga ba ang magagawa ko?\nAlam ko nang hindi na tayo magtatagpo\nDahil ikaw na lang ang aking hinihintay\nMakuha ko ang \'yong tingin at ang iyong...\n\n@chorus\nAno pa nga ba ang magagawa ko? (Ano pa nga ba ang magagawa ko?)\nAlam ko nang hindi na tayo magtatagpo\nDahil ikaw na lang ang aking hinihintay\nMakuha ko ang \'yong tingin at ang iyong...\n\n@outro\nMakuha ko ang \'yong ngiti at ang iyong...\nMakuha ko ang \'yong tingin at ang iyong...\nIsang \"Hi\"', 2, NULL, NULL, '2024-10-25 06:01:05', '2024-11-15 15:52:38', 'tl'),
