(706, 706, '@verse\nSa hindi inaasahang\nPagtatagpo ng mga mundo\nMay minsan lang na nagdugtong\nDamang-dama na ang ugong nito\n\n@verse\n\'Di pa ba sapat ang sakit at lahat\nNa hinding-hindi ko ipararanas sa \'yo?\nIbinubunyag ka ng iyong matang\nSumisigaw ng pagsinta\n\n@chorus\nBa\'t \'di papatulan ang pagsuyong nagkulang?\nTayong umaasang hilaga\'t kanluran\nIkaw ang hantungan, at bilang kanlungan mo\nAko ang sasagip sa \'yo, whoa\nOh, oh, oh\n\n@verse\nSa\'n nga ba patungo? (Sa\'n nga ba patungo?)\nNakayapak at nahihiwagaan\nAng bagyo ng tadhana ay\nDinadala ako sa init ng bisig mo\n\n@chorus\nBa\'t \'di pa sabihin ang hindi mo maamin?\nIpauubaya na lang ba \'to sa hangin?\n\'Wag mong ikatakot ang bulong ng damdamin mo (ng damdamin mo)\nNaririto ako\'t nakikinig sa \'yo\n\n@outro\nOh, oh, oh, oh\nOh, oh, oh\nOh, oh, oh, oh\nOh, oh\nHa, ha, ha, ha\nHa, ha, ah\nHa, ha, ah\nHa, ha, ha', 2, NULL, NULL, '2024-10-25 06:01:05', '2024-10-30 04:27:53', 'tl'),
