(843, 843, 'Dalangin ang lagi mong habilin\nNababawi mo ang lungkot na nararamdaman\nAt inaamin ko na ang dumadaan sa aking isip (isip)\nAy kung ayos ka pa ba\n\nNi kahit minsan ay \'di dumilim ang gabi\nNasisilaw lang gusto ko rin naman\nSa kada araw sa presensiya mo lang\nHumahanap ng lakas ng loob\n\nNasusulit ko ang aking bawat umaga\n\'Pag ikaw na ang kapiling\nNasusulit ko ang aking bawat umaga\n\'Pag ikaw na ang kapiling\n\nAng \'yong sinag ay nauuna pa sa araw\nAt gaano man kababaw ika\'y umiilaw\nAt sa ngiti mong patago (patago)\nKumpleto ang binubuo kong puso (ah)\n\nOh buhay (buhay)\nOh ikaw ang binigay ah (ikaw ang binigay)\nOh buhay (buhay)\nIkaw ang binigay (ikaw ang binigay)\n\nAng buwan ay naninibugho\nSa iyong ningning (ningning oh)\nAt ang kislap ng iyong mata ay nagpapaalala sa mga bituin\nMy love where have you been\n\nNasusulit ko ang aking bawat umaga\n\'Pag ikaw na ang kapiling\nNasusulit ko ang aking bawat umaga\n\'Pag ikaw na ang kapiling\n\nAng \'yong sinag ay nauuna pa sa araw\nAt gaano man kababaw ika\'y umiilaw\nAt sa ngiti mong patago (at sa ngiti mong patago)\nKumpleto ang binubuo kong puso (ah ah)\n\nOh buhay (dito sa \'king buhay)\nIkaw ang binigay (ikaw ang binigay) ah ah\nOh buhay (oh dito sa \'king buhay)\nIkaw ang binigay (ikaw ang tanging binigay)\n\nOh buhay\nIkaw ang binigay (binigay)\nHmm', 1, 1, 1, '2024-10-25 06:01:05', '2024-11-02 04:58:23', 'tl'),
