(1031, 1031, '@verse\nIf I could tell you all the things you are to me\nI\'d try to fit them all inside this song\nThe words I sing won\'t give our love no justice\n\'Cause what we have\'s a blessing from above\n\n@pre-chorus\nThough the winds may change\nAnd the lights may fade\nOur love will see us through\n\n@chorus\nTake this heart to be yours, only yours\nAnd every part of you will be mine, only mine\nEven the ghosts and all the fears\nEven the most uncertain years\nI\'ll hold you close, it starts tonight\nThe night when our lives intertwine\n\n@verse\nIf I could tell you all the times I prayed to Him\nYou would find them several hours long (ooh)\nBut I heard the heart speaks louder than a million voices raised\nNow, the answer to my loudest prayer is standing here today\n\n@pre-chorus\nThough the winds may change\nAnd the lights may fade\nOur love will see us through\n\n@chorus\nSo take this heart to be yours, only yours\nAnd every part of you will be mine, only mine\nEven the ghosts and all the fears\nEven the most uncertain years\nI\'ll hold you close, it starts tonight\nThe night when our lives intertwine\n\n@chorus\nTake this heart to be yours, only yours\nAnd every part of you will be mine, only mine\nEven the ghosts and all the fears\nEven the most uncertain years\nI\'ll hold you close, it starts tonight\nThe night when our lives intertwine\nThe night when our lives intertwine', 1, 1, 1, '2024-10-25 06:01:05', '2024-11-02 04:58:23', NULL),
