(1180, 1180, '@verse 1\nNag-iisa, nakadungaw\nSa bintana; ako ba\'y nagkulang?\nNakaupo, lumalayo\nSa tukso, upang \'di na magulo\n\n@chorus\nIsasayaw ka sa ulap\nAt mag-uusap, hindi manghuhula\nIsasayaw ka sa ulap\nHindi hahayaang mahulog nang tuluyan\n\n@verse 2\nNagkamali ba ako sa \'yo?\nNananatiling blangko ito (blangko ito)\nNaririnig ang tinig mo\nNabubuong muli ang pag-ibig ko (ang pag-ibig ko)\n\n@chorus\nIsasayaw ka sa ulap\nAt mag-uusap, hindi manghuhula\nIsasayaw ka sa ulap\nHindi hahayaang mahulog nang tuluyan\n\n@bridge\nOh, gusto kang makasama\nAko na ang bahala\nHuwag ka lang mawalay\nAtin nang kulayan ang ating mundo\nTumingin sa akin\nLanghapin ang hangin\nBakit ba nasanay?\nIsip ay nadadamay sa puso\n\n@chorus\nIsasayaw ka sa ulap\nAt mag-uusap, hindi manghuhula\nIsasayaw ka sa ulap\nHindi hahayaang mahulog nang tuluyan\n\n@outro\nNag-iisa, nakadungaw', 1, 1, 1, '2024-10-25 16:53:25', '2024-11-02 04:58:23', NULL),
