(1413, 1413, 'I’ll never forget that day we first met\nIn a dim-lit room where our hearts set\nWith your eyes shining bright and smile so fine\nYou took my breath away, my love, that night\n\nAnd I finally gained my strength\nAnd now I can face the world\n\nI never thought I’d find the courage to speak\nYou made it easy, your love made me weak\nThough distance may keep us so far apart\nI’ll fill your spirit, love, and mend your heart\n\nEven miles away, we’re still talking and loving,\nWith your love from there, each day’s a special day\nYou’re always with me, no matter the space\nTogether forever, our love will remain\n\nAnd I finally gained my strength\nWith you, I will face the world\n\nI never thought I’d find the courage to speak\nYou made it easy, your love made me weak\nThough distance may keep us so far apart\nI’ll fill your spirit, love, and mend your heart\nI’ll fill your spirit, love, and mend your heart\n\nJourneying through life with you, hand in hand\nGrowing old together, our love shall stand\nAging gracefully with you\nForever in love, that’s true\n\nI never thought I’d find the courage\nI never thought I’d find the courage to speak\nYou made it easy, your love made me weak\nThough distance may keep us so far apart\nI’ll fill your spirit, love, and mend your heart\n\nI’ll fill your spirit, love, and mend your heart\nI’ll fill your spirit, love, and mend your heart', 2, NULL, NULL, '2024-10-25 19:06:16', '2024-10-31 02:00:46', 'en'),
