(1420, 1420, 'Natapos na ang lahat\nNandito pa rin ako\nHetong nakatulala\nSa mundo, sa mundo\n\nHindi mo maiisip\nHindi mo makikita\nAng mga pangarap ko\nPara sa \'yo, para sa \'yo\n\nOh-oh-oh-oh\nHindi ko maisip kung wala ka\nOh-oh-oh-oh\nSa buhay ko\n\nNariyan ka pa ba?\nHindi ka na matanaw\nKung mayro\'n bang daraanang\nPasulong, pasulong\n\nOh-oh-oh-oh\nHindi ko maisip kung wala ka\nOh-oh-oh-oh\nSa buhay ko\n\nSundan mo\nAng paghimig na lulan na aking pinagtatanto\nSundan mo\nAng paghimig ko\n\nOh-oh-oh-oh\nHindi ko maisip kung wala ka\nOh-oh-oh-oh\nSa buhay ko', 1, 1, 1, '2024-10-26 06:27:39', '2024-11-02 04:58:23', 'tl'),
