(2131, 2128, '@verse 1\nSa wari ko\'y lumipas na\nAng kadiliman ng araw\nDahan-dahan pang gumigising\nAt ngayo\'y babawi na\n\n@pre-chorus\nMuntik na\nNasanay ako sa\'king pag-iisa\nAt kaya nang iwanan\nAng bakas ng kahapon ko\n\n@chorus\nTuloy pa rin ang awit ng buhay ko\nNagbago man ang hugis ng puso mo\nHanda na \'kong hamunin ang aking mundo\n\'Pagkat tuloy pa rin\n\n@verse 2\nKung minsan ay hinahanap pa\'ng\nAlaala ng \'yong halik (Alaala ng \'yong halik)\nInaamin ko na kay tagal pa\nBago malilimutan ito\n\n@pre-chorus\nKay hirap nang maulit muli\nAng naiwan nating pag-ibig (Alam ko na \'yan)\nTanggap na at natututo pang\nHarapin ang katotohanang ito, ooh-woah\n\n@chorus\nTuloy pa rin ang awit ng buhay ko\nNagbago man ang hugis ng puso mo\nHanda na \'kong hamunin ang aking mundo\n\'Pagkat tuloy pa rin (Ooh-woah, oh)\nTuloy pa rin ang awit ng buhay ko\nNagbago man ang hugis ng puso mo\nHanda na \'kong hamunin ang aking mundo\n\'Pagkat tuloy pa rin\n\n@instrumental\n\n@pre-chorus\nMuntik na\nNasanay ako sa\'king pag-iisa\nAt kaya nang iwanan ang\nBakas ng kahapon ko, oh\n\n@chorus\nTuloy pa rin ang awit ng buhay ko\nNagbago man ang hugis ng puso mo\nHanda na \'kong hamunin ang aking mundo\n\'Pagkat tuloy pa rin (Ooh-woah, oh)\nTuloy pa rin ang awit ng buhay ko\nNagbago man ang hugis ng puso mo\nHanda na \'kong hamunin ang aking mundo\n\'Pagkat tuloy pa rin\nTuloy pa rin ang awit ng buhay ko (Tuloy pa rin)\nNagbago man ang hugis ng puso mo (Hugis ng puso mo)\nHanda na \'kong hamunin ang aking mundo (Hamunin)\n\'Pagkat tuloy pa rin (Tuloy pa rin)\nTuloy pa rin ang awit ng buhay ko (Dahan-dahan pa)\nNagbago man ang hugis ng puso mo (Dahan-dahan pang babawi sa puso mo)\nHanda na \'kong hamunin ang aking mundo\n\'Pagkat tuloy pa rin\nTuloy pa rin ang awit ng buhay ko (Tuloy pa rin)\nNagbago man ang hugis ng puso mo (Ooh-woah-oh, yeah)\nHanda na \'kong hamunin ang aking mundo (Kaya nang harapin ang mundo)\n\'Pagkat tuloy pa rin (Ooh-woah-oh, woah-woah)\nTuloy pa rin ang awit ng buhay ko (Awit ng buhay ko)\nNagbago man ang hugis ng puso mo (Nagbago ang puso mo)\nHanda na \'kong hamunin ang aking mundo (Hamunin)\n\'Pagkat tuloy pa rin', 1, 1, 1, '2024-10-26 17:09:44', '2024-11-02 04:58:23', NULL),
