(2548, 2545, '@intro\nYou know, there\'re a lot of sucker emcees out there, right? (Mmm-hmm)\nLot of sucker DJs (mmm-hmm), lot of wannabes (uh-huh)\nFor me, I\'m a sucker for, for helium, here\nYeah, I like this stuff, man, huh\nThis is one real shit, man\nYou like some?\n(Hey, Maxine?) Maxine, you like some?\n\n@verse\nSo many faces, so many races\nDifferent voices, different choices\nAnd some are mad, while others laugh\nSome live alone with no better half\nOthers grieve while others curse\nAnd others mourn behind a big black hearse\nAnd some are pure, and some half-bred\nAnd some are sober, and some are wasted\nSome are rich because of fate\nAnd some are poor with no food on their plate\nSome stand out while others blend\nAnd some are fat and stout while some are thin\n\n@pre-chorus\nAnd some are friends, and some are foes\nSome have some while some have most, yeah\n\n@chorus\nEvery color and every hue\nIs represented by me and you\nTake a slide in the slope\nTake a look in the kaleidoscope\nSpinnin\' round, make it twirl\nIn this kaleidoscope world, yeah\n\n@verse\nSome are great, and some are few\nOthers lie while some tell the truth\nAnd some say poems, and some do sing\nAnd others sing through their guitar strings\nSome know it all while some act dumb\nLet the bassline strum to the bang of the drum\nAnd some can swim while some will sink\nAnd some will find their minds and think\nOthers walk while others run\nYou can\'t talk peace and have a gun\nSome are hurt and start to cry\nDon\'t ask me how, don\'t ask me why\n\n\n@pre-chorus\nAnd some are friends, and some are foes\nSome have some while some have most, yeah\n\n@chorus\nEvery color and every hue\nIs represented by me and you\nTake a slide in the slope\nTake a look in the kaleidoscope\nSpinnin\' round, make it twirl\nIn this kaleidoscope world\n\n@outro\nKaleidoscope world\nIn this kaleidoscope world', 1, 1, 1, '2024-10-26 18:59:17', '2024-11-02 04:58:23', NULL),
