(2830, 2778, 'Kay tagal na rin natin sa isat isa\nDi ko na mabilang pa\nIlang taon na ba\nNgunit hanggang ngayon\nIkaw pa rin sinta\nAng nasa puso ko at kaluluwa\n\nDahil ang pag ibig ko sayo\nAy hindi magababago\nKahit kailan ikaw lamang\nAng mananatili sa puso ko\nHabang buhay ay ikaw lang at ako\n\nSa lungkot at sa saya\nIkaw ang kasama\nDi kailangan magduda\nWala namang iba\nDahil hanggang ngayon\nIkaw pa rin sinta\nAng nasa puso ko at kaluluwa\n\nDahil ang pag ibig ko sayo\nAy hindi magababago\nKahit kailan ikaw lamang\nAng mananatili sa puso ko\nHabang buhay ay ikaw lang at ako\n\nDi malilimutan ang pangako ko sayo\nNang sa habang buhay ay ikaw lamang at ako\n\nDahil ang pag ibig ko sayo\nAy hindi magababago\nKahit kailan ikaw lamang\nAng mananatili sa puso ko\nHabang buhay ay ikaw lang at ako\nHabang buhay ay ikaw lang at ako\nHabang buhay ay ikaw lang at ako', 1, 1, 1, '2024-10-27 03:04:25', '2024-11-02 04:58:23', 'tl'),
