(3155, 3152, 'Kusa bang pumasok sa utak mong mapanghusga\nNa ako na lang ang laging mayro\'ng kasalanan?\nLagi mong pinupuna aking mga nagawa\nAt ihalintulad sa \'king mga nakaraan\n\nKahit \'di mo na aminin\nMay gusto ka na sabihin\n\nKanina pa ako naghihintay sa \'yo\nSa iyong konsensiya\'t pasensiya mo\nUulitin ang mga sinabi ko\nAt tumatak ang \"\'di laging ako\"\n\nParang lasa ng alak, sa una\'y hirap lunukin\n\'Pag tumagal sa tiyan ay mayro\'n kang babaliktarin\nAno ba\'ng sinasabi mo sa sirang telepono?\nKung sino-sino\'ng tinawagan, nandito lang ako\n\nKahit \'di mo na aminin\nMay gusto ka na sabihin\n\nKanina pa ako naghihintay sa \'yo\nSa iyong konsensiya\'t pasensiya mo\nUulitin ang mga sinabi ko\nAt tumatak ang \"\'di laging ako\"\n\nAt kung ako naman ang magsalita\nAt kung ako naman ang magsalita', 1, 1, 1, '2024-10-27 03:52:37', '2024-11-02 04:58:23', 'tl'),
