(3434, 3431, 'Now here\'s something from Rivermaya\n\nHiwaga ng panahon\nAkbay ng ambon\nSa piyesta ng dahon\nAko\'y sumilong\n\nDaan-daang larawan ang\nNagdaraan sa \'king paningin\nDaan-daang nakaraan\nIbinabalik ng simoy ng hangin\n\nTatawa na lamang\nAt ba\'t hihikbi?\nAng aking damdamin\nPinaglalaruan ng baliw at ng ulan\nAt sino\'ng \'di mapapasayaw ng ulan?\nAt sino\'ng \'di mababaliw sa ulan?\n\nHinulog ng langit (hinulog ng langit)\nNa s\'yang nag-ampon\nLibo-libong alaala\nDala ng ambon\n\nDaan-daang larawan ang\nNagdaraan sa \'king paningin\nDaan-daang nakaraan\nIbinabalik ng simoy ng hangin\n\nTatawa na lamang\nOh, bakit hindi?\nAng aking damdamin\nPinaglalaruan ng baliw at ng ulan\nAt sino\'ng \'di mapapasayaw ng ulan?\nAt sino\'ng \'di mababaliw sa ulan?\n\nTatawa na lamang\nOh, bakit hindi?\nAng aking damdamin\nPinaglalaruan ng baliw at ng ulan\nAt sino\'ng \'di mapapasayaw ng ulan?\nSino\'ng \'di mababaliw sa ulan?\nAt sino\'ng \'di aawit kapag umulan?\nAt sino\'ng \'di mababaliw? (Ako)\n\nUlan, at sino\'ng \'di mapapasayaw?\nUlan, at sino\'ng \'di mababaliw sa ulan?\nUlan, ulan\nSa ulan, oh', 1, 1, 1, '2024-10-27 04:40:46', '2024-11-02 04:58:23', 'tl'),
