(3456, 3453, '\'King mga pulong kong di nako masulti\nTigumon ko na lang ba ni\nUg ihulog sa alkansiya\'s imong dughan\nHulatong modaghan aron sa gugma mo pailisan\n\nUsa lamang ko ka abog sa imong kaanyag\nMahimo ba kong mohangop\nSa kamot mong samaran nga gitukod mo dihang\nNahulog ka gikan sa kalangitan\n\nPaigo ba ning usa ka gatos ka mga bulak\nIsip halad sa mala-santa mong nawong\nWalay makatupong sa kagamay sa imong mata\nDuna ba kay makita nga paglaom para natong duha\n\nSa pagtug-an ko na sa akong gibati\nKatawa ra imong tubag\nSa diha nga higayon kalit lang mihunong\nAng kalibutan\n\nDi na ba gyud mabag-o imong tan-aw nako\nWala na ba\'y luna diha sa imong dughan\n\nPaigo ba ning usa ka gatos ka mga bulak\nIsip halad sa mala-santa mong nawong\nWalay makatupong sa kagamay sa imong mata\nDuna ba kay makita nga paglaom para natong duha\nPaglaom para natong\n\nDuha ka tuig ra man unta\'ng imong labaw\nSa atong pangidaron\nMakapungot nga maungot sa mura ra ka\'g igsuon\nPagkamalason\n\nWhoa oh pasayloa ko\nKung nahigugma ko nimo\nBasin puhon imong lingion\nKung moabot man na nga panahon\n\nPaigo ba ning usa ka gatos ka mga rosas\nIsip halad sa mala-santa mong nawong\nWalay makatupong\n\nPaigo ba ning usa ka gatos ka mga rosas\nIsip halad sa mala-santa mong nawong\nWalay makatupong sa kagamay sa imong mata\nDuna ba kay makita nga paglaom para natong duha\n\nSa kagamay sa imong mata\nDuna ba kay makita nga paglaom para natong duha\n\nBisan diri man lang sa akong kanta\nMagkadayon tang duha', 1, 1, 1, '2024-10-27 04:57:58', '2024-11-02 04:58:23', 'ceb'),
