(3732, 515, '@verse 1\nMy peace is in You, Lord\nMy joy is in You, Lord\nGazing at You, looking at You\nHappiness\n\n@verse 2\nMy life is for You, Lord\nAll my time I give to You, Lord\nBeing with You, loving You\nOnly You\n\n@chorus\nNot me, but You\nNot my will but forever Yours\n\"Essere sempre unito a Gesù\nEcco il mio programma di vita!\"\nTo always be close to Jesus\nThat\'s my life plan\nIn my heart, in my soul, in my life\nNot me, but God\n\n@verse 3\nBe near You, my home\nTo please You, my prayer\nTo proclaim You\nAnd to bring You to All\n\n@chorus\nNot me, but You\nNot my will but forever Yours\n\"Essere sempre unito a Gesù\nEcco il mio programma di vita!\"\nTo always be close to Jesus\nThat\'s my life plan\nIn my heart, in my soul, in my life\n\n@chorus\nNot me, but You\nNot my will but forever Yours\n\"Essere sempre unito a Gesù\nEcco il mio programma di vita!\"\nTo always be close to Jesus\nThat\'s my life plan\nIn my heart, in my soul, in my life\nNot me, but God\n\n@outro\nNot me, but God\nNot me, but God', 1, 1, 1, '2024-10-27 06:01:27', '2024-11-02 04:58:23', 'en'),
