(4037, 4033, 'Gagawin ko ang lahat upang\nSa huli, sa huli, sa huli ay tayo\nKung kailangan kong tahakin ang\nKilome-kilome, kilometrong layo (layo, layo)\nYeah, whoa-oh\nOh-oh\n\nBakit nga ba itong agwat natin\nPinipilit palawakin?\nPero habang mayro\'ng bumabalakid\nAng pag-ibig lumalalim\n\nTila tala sa tala ang layo\nAt \'di ka na matanaw\nPero \'pag humahaba ay\nLalo kitang sinisigaw\n\nMaging ang laot, walang takot na tatawirin\nKahit alon ay umabot sa papawirin\nSa\'n man dako\'y pinangakong makakarating\nIkaw lang ay makapiling\n\nGagawin ko ang lahat upang\nSa huli, sa huli, sa huli ay tayo\nKung kailangan kong tahakin ang\nKilome-kilome, kilometrong layo\nWhoa, whoa, whoa\nKilome-kilome, kilometrong layo\nWhoa, whoa, whoa\nKilome-kilome, kilometrong layo (layo, layo)\n\nSumasalungat ang daigdig\nAt tayo\'y \'di magkasalubong\nAt dapat na ba \'kong makinig?\nMagpadala na sa daluyong\nInanod, inagos\nAt halos hindi ka na matanaw\nPagtapos mabalot ng galos\nSigaw pa rin ay ikaw (ay ikaw)\n\nMaging ang laot, walang takot na tatawirin (oh)\nKahit alon ay umabot sa papawirin (oh)\nSa\'n man dako\'y pinangakong makakarating\nIkaw lang ay makapiling (oh, whoa)\n\nGagawin ko ang lahat upang\nSa huli, sa huli, sa huli ay tayo (gagawin ko ang lahat)\nKung kailangan kong tahakin ang\nKilome-kilome, kilometrong layo\nWhoa, whoa, whoa\nKilome-kilome, kilometrong layo\nWhoa, whoa, whoa\nKilome-kilome, kilometrong layo\n\nMaging ang laot, walang takot na tatawirin\nKahit alon ay umabot sa papawirin\nSa\'n man dako\'y pinangakong makakarating\nIkaw lang ay makapiling\n\nGagawin ko ang lahat upang\nSa huli, sa huli, sa huli ay tayo (sa huli ay tayo)\nKung kailangan kong tahakin ang\nKilome-kilome, kilometrong layo (whoa)\nWhoa, whoa, whoa\nKilome-kilome, kilometrong layo\nWhoa, whoa, whoa\nKilome-kilome, kilometrong layo\nOh, whoa (whoa, whoa, whoa)\nWhoa, whoa, whoa (kilometrong layo)\nKilome-kilome, kilometrong layo', 1, 1, 1, '2024-10-27 06:20:02', '2024-11-02 04:58:23', 'tl'),
