(4400, 4396, 'Kailan mo ako hahagkan\nMatagal na akong naghihintay\nNakadungaw sa bintana\nMga dahon lang ang kumakaway\n\nKailan ko mararamdaman\nPagdampi ng iyong labi\nTinatanaw ko ang mga bituin\nMga luhang humahalik sa aking pisngi\n\nKailan ako tatahan (ho)\nHikbi ng yakap ng iyong dibdib (ho)\nNakatingin ako sa salamin (ho)\nMay guhit ang loob mapait ang ngiti\n\nKailan ko mararamdaman\nPagdampi ng iyong labi\nTinatanaw ko ang mga bituin\nMga luhang humahalik sa aking pisngi\n\nKailan ko masisilayan\nSa araw-araw aking mahal\nMula pag-gising hanggang sa pag-idlip\nKagandahan mo walang patid\n\nKailan mo ako hahagkan (ho)\nMatagal na akong naghihintay (ho)\nNakadungaw sa bintana (ho)\nMga dahon lang ang kumakaway\n\nKailan ko mararamdaman\nPagdampi ng iyong labi\nTinatanaw ko ang mga bituin\nMga luhang humahalik sa aking pisngi\n\nKailan ako lalaya\nSa anino ng pag-iisa\nMga rehas lang ang tanaw\nNanginginig sa seldang maginaw (oh)', 1, 1, 1, '2024-10-27 10:17:42', '2024-11-02 04:58:23', 'tl'),
