(4664, 4660, '\'Di mo naman ako kailangan\nHindi mo naman sinasadya\nKlaro namang ika\'y napilitan\nSa nagmakaawa kong mata\nHindi rin naman kita pinilit\nHindi rin naman kita hinayaang lumayo\n\nNgunit sa huli, ika\'y tumatakbo palayo\nAt sa huli, ika\'y nagtataka\nBa\'t pa napagbigyan ng pagkakataon?\nDahil sa huli, ikaw ay nauntog sabay layo\nDahil sa huli, hanggang sa huli\nAko\'y tinapon\n\nWala ka namang pinagbasehan\nWala ka namang mapapala\nKlaro namang ika\'y nabigla (nabigla)\nWala kang nagawa no\'ng tuluyan akong lumuha\nWala rin naman sa \'king problema\nWala rin naman na higit pang mawawala\n\nNgunit sa huli, ika\'y tumatakbo palayo\nAt sa huli, ika\'y nagtataka\nBa\'t pa napagbigyan ng pagkakataon?\nDahil sa huli, ikaw ay nauntog sabay layo\nDahil sa huli, hanggang sa huli\nAko\'y tinapon\n\nKung may \'pagagawa ka muna para sa akin\nAy pwede kang lumapit\nNang sa huli\'y paalam ay damdamin\n\nNgunit sa huli, ika\'y tumatakbo palayo\nAt sa huli, ika\'y nagtataka\nBa\'t pa napagbigyan ng pagkakataon?\nDahil sa huli, ikaw ay nauntog sabay layo\nDahil sa huli, hanggang sa huli\nAko\'y tinapon', 1, 1, 1, '2024-10-27 11:34:35', '2024-11-02 04:58:23', 'tl'),
