(4671, 4667, '\'Di na \'ko makapaghintay\nMakatulog, managinip\nHawak ang iyong kamay\nSa may sulok, sa may gilid\nAng ibig kong sabihin ay\n\'Di man kita maabot\nPero \'pag ako ay nakahiga\nTayo ay nagpapantay\n\nMata sa mata, ilong sa ilong\nBibig sa bibig, mga halik sa leeg\nKasabay ng mga kanta na nakakakilig\nAng sarap makinig\nHabang dumidila ka pababa ng dibdib\nPababa sa lugar kung saan ay liblib\nSa lakas ng huni ay sumasabay\nPati ang mga kuliglig\n\nAko\'y atat na atat na\nSapagkat nalulungkot ang inyong lingkod\nSana magpakita ka na\n\'Pag \'di ka sumipot, naku po, hindot\nAlam mo bang kung ang laro ay taguan\nAko ang laging taya?\nHinahanap-hanap kita\n\'Di kita matagpuan, nasa\'n ka kaya?\n\nBusog ang lahat ng buwaya\nKasi ika\'y makalaglag-matsing\nKaso matigas ang iyong leeg\nSa katulad ko, \'di ka namamansin\nSana ang pag-ibig ay katulad ng pamasahe\nSa jeep, sa trike, sa bus at sa tren\nKahit na buo ang binibigay mo\nSana kahit papa\'no, may sukli ka pa rin\n\nMga kamay ko ay nalulumbay\n\'Di makapaghintay\nMahawakan ang sa \'yo, whoa\nMahawakan, mahawakan ang sa \'yo, whoa\nAt ang labi ko ay nangungulila\nSana nga ay madampian ng iyo, ng iyo, ng iyo\nMadampian ng iyo\n\n\'Di na \'ko makapaghintay\nMakatulog, managinip\nSakaling makaakbay\nSa may sulok, sa may gilid\nWalang mga matang nagbabantay\nTara, humiga ka sa aking tabi\nNang tayo ay magpantay\n\nNagbabasahan ang mga utak\nTila nagpapasahan ng mga sulat\nTakpan man ng mga ulap\nBuo pa rin ang pangungusap ng mga matang nangungusap\nSa init ng ating katawan\nDaig pa ang disyerto\nAng malamig na silid at presko\nPanandalian naging impiyerno\n\nKahit saan ang puwesto\nTuloy pa rin ang kuwento\nMasigabong palakpakan\nPagkatapos ng konsiyerto\nSago\'t gulaman, gin, pomelo, saging con yelo\nIsang modelo, isang kuneho\nMagkakaiba man, pero swak pareho\n\nSa mundong \'to, terno tayo ng kulay\nMagkasalungat sa tunay na buhay\nIkaw \'yung orig na nahalo sa ukay\nAko \'yung prutas na naakit sa gulay\nButi na lang, wala kang kasama\nPagkakataon upang makilala\nBago ko lang matuldukan\nSubukan nating simulan sa comma (comma, comma)\n\nMga kamay ko ay nalulumbay\n\'Di makapaghintay\nMahawakan ang sa \'yo, whoa\nMahawakan, mahawakan ang sa \'yo, whoa\nAt ang labi ko ay nangungulila\nSana nga ay madampian ng iyo, ng iyo, ng iyo\nMadampian ng iyo\n\nAko\'y atat na atat na\nAko\'y atat na atat na\nAko\'y atat na atat na\n(Madampian ng iyo)\nAko\'y atat na atat na\nAko\'y atat na atat na\nAko\'y atat na atat na\n(Madampian ng iyo)\n\n\'Di na \'ko makapaghintay\nMalalim na ang gabi\nMakunat na ang tinapay\nMalamig na ang kape\n\'Di na mapakali\nAndiyan ka na ba?\nDalian mo naman\nPara mahaba ang oras nating dalawa\n\nMay usapan tayo, alas-dose\n\'Wag kang makalimot\nWala ka sa tulay ng San Juanico\n\'Wag kang magpakipot\nPunuan man ang puso mo\nWala sanang magalit\nHanda akong sumabit\nAyos lang kahit mangawit dahil\n\nMga kamay ko ay nalulumbay\n\'Di makapaghintay\nMahawakan ang sa \'yo, whoa\nMahawakan, mahawakan ang sa \'yo, whoa\nAt ang labi ko ay nangungulila\nSana nga ay madampian ng iyo, ng iyo, ng iyo\nMadampian ng iyo\n\n\'Wag na nating ipagpabukas pa (ako\'y atat na atat na)\nGusto ko sana, ngayon na (madampian ng iyo)\n\'Wag na nating ipagpabukas pa (ako\'y atat na atat na)\nGusto ko sana, ngayon na (madampian ng iyo)\n\'Wag na nating ipagpabukas pa (ako\'y atat na atat na)\nGusto ko sana, ngayon na (madampian ng iyo)\n\'Wag na nating ipagpabukas pa (ako\'y atat na atat na)\nGusto ko sana, ngayon na (madampian ng iyo)', 1, 1, 1, '2024-10-27 11:50:05', '2024-11-02 04:58:23', 'tl'),
