(4886, 4882, '@verse 1\nBakit ba nagpapaakit\nSa bawat likha mong tinig?\n\'La namang kasiguraduhan\nMayro\'n ba akong kalalagyan\nSa magulo mong damdamin?\n\'Di alam kung para sa \'kin ba\nAng iyong nararamdaman\nKailan mo balak na punan?\n\n@pre-chorus\nAh, patlang\nLumalalim kada hakbang palapit\nSadya bang walang malinaw na sagot?\nParang palaisipan\n\n@chorus\nHulaan, \'lang kalaban-laban\n\'Di ka mailagan\nGusto mo lang ba \'ko\nSa tuwing ika\'y nag-iisa?\n\n@post-chorus\nHula-hulaan, hula-hulaan\nHula-hulaan, hula-hula\n\n@verse 2\nSige, sakyan ko na \'yong gimik\nHalo-halo man ang pahiwatig mo\nDapat na bang matauhan?\nApat na buwan ka ng pinagbibigyan\n\n@pre-chorus\n(Haba-haba ng) patlang\nLumalalim kada hakbang palapit\nSadya bang walang malinaw na sagot?\nParang palaisipan\n\n@chorus\nHulaan, \'lang kalaban-laban\n\'Di ka mailagan\nGusto mo lang ba \'ko\nSa tuwing ika\'y nag-iisa?\n(Hulaan)\nAno\'ng panghahawakan?\n\'Di malaman-laman\nSa \'kin mo lang ba \'to ginagawa?\nHmm\nHula-hulaan, hula-hulaan\nHula-hulaan, hula-hulaan (hmm)\n\n@bridge\n(Hula-hulaan, hula-hulaan) gusto lang ako \'pag nag-iisa\n(Hula-hulaan, hula-hulaan) hanap lang ako \'pag nangangamba\n(Hula-hulaan, hula-hulaan) puro ka amba, nakakalito kang ibigin\n(Hula-hulaan, hula-hulaan) kung \'di pa handa, ba\'t pabalik-balik sa \'kin?\n(Hula-hulaan, hula-hulaan) puro ka amba, nakakalunod kang ibigin\n(Hula-hulaan, hula-hulaan) kung \'di pa handa, ba\'t pabalik-balik sa \'kin?\n\n@chorus\nHulaan, ano\'ng panghahawakan?\n\'Di malaman-laman\nGusto mo lang ako sa \'yong pag-iisa', 1, 1, 1, '2024-10-28 21:25:34', '2024-11-13 19:04:22', 'tl'),
