(4909, 4905, '@verse\nSumasayaw ang umaga pero \'di makagalaw\nSumasayaw ang umaga pero \'di matatanaw\n\"Ayos lang,\" sabi niya, \"Ayos lang\"\n\n@verse\nUmaawit ang umaga na wala sa himig\nUmaawit ang umaga\'t walang nakaririnig\n\"Ayos lang,\" sabi niya, \"Ayos lang\"\n\n@chorus\nKailan makikita, maririnig, mararamdaman\nAng paglubog ng araw?\nOoh, sa isip\n\n@verse\nNananatili ang umaga at walang pumapansin\nNananatili ang umaga at walang nakatingin\n\"Ayos lang,\" sabi niya, \"Ayos lang\"\n\n@chorus\nPa\'nong malalaman, madarama, mauunawaan\nAng hinaing ng araw?\nSana sa kaniyang pagbangon\nMatanggap nawa siya\n\n@outro\nOoh, sa isip (sa isip)\nOoh, sa isip (sa isip)\nOoh, sa isip (sa isip)\nOoh, sa isip', 2, NULL, NULL, '2024-10-28 22:35:20', '2024-10-29 08:43:16', 'tl'),
