(4912, 4908, 'Sino \'to?\nHello?\nOy, p\'re!\nOh, boy, napatawag-\nAy, may \'paparinig ako sa \'yo kanta\nAh, sige, sige, sige\nSaan ako nagkulang? (Oh, ganda, p\'re, ah)\nHindi ko maunawaan (\'no \'to? Bago mo?)\nAko\'y nahihirapan (ayos, ah)\nHangad na malinawan (lupit, man, lupit)\nHiling ko naman ay\nAko ay masamahan\nSa langit ng- (oy, ganito na lang, p\'re)\nAyos ba?\nP\'re, \'labas mo na \'yan\nHa?\n\'Labas mo na \'yan, man\nEh, \'di ko pa \'to tapos, man\nMay kailangan pa \'kong tapusin\nAy, gano\'n?\nOo, gano\'n\nAh, sige, sige, sige\nSige, sige, thank you sa pakikinig, p\'re\nAh, sige, sige, thank you, thank you\nSige, sige, sige, salamat', 2, NULL, NULL, '2024-10-28 22:35:20', '2024-11-03 20:22:58', 'tl'),
