(5166, 1769, '@verse\nI look up at the sky\nAnd think of you on lazy afternoons\nBy the time it starts to cry\nI\'ve understood how fond I am of you\n\n@chorus\nWho you are to me\nIs who I wanna be for you\nAnd all you are to me\nIs what I strive to be for you\n\n@verse\nYou\'ve always been a friend\nAnd even one that\'s difficult to find\nI can\'t lose you, I\'m afraid\nWhen in my life, you are the brightest light\n\n@chorus\nWho you are to me\nIs who I wanna be for you\nAnd all you are to me\nIs what I strive to be for you\n\n@chorus\nWho you are to me\nIs who I wanna be for you\nAnd all you are to me\nIs what I strive to be for you\n\n@outro\nI want to be for you\nI want to be for you\nI want to be for you', 1, 1, 1, '2024-10-31 10:15:42', '2024-11-02 04:58:23', 'en'),
(5167, 1931, '@verse 1\nKamukha mo si Paraluman\nNo\'ng tayo ay bata pa\nAt ang galing-galing mong sumayaw\nMapa-boogie man o cha-cha\nNgunit ang paborito\nAy pagsayaw mo ng El Bimbo\nNakakaindak, nakakaaliw\nNakakatindig-balahibo\n\n@pre-chorus 1\nPagkagaling sa \'skuwela ay\nDederetso na sa inyo\nAt buong maghapon ay\nTinuturuan mo ako\n\n@chorus\nMagkahawak ang ating kamay\nAt walang kamalay-malay\nNa tinuruan mo ang puso ko\nNa umibig na tunay\n\n@verse 2\nNaninigas ang aking katawan\n\'Pag umikot na ang plaka\nPatay sa kembot ng bewang mo\nAt pungay ng \'yong mga mata\nLumiliwanag ang buhay\nHabang tayo\'y magkaakbay\nAt dahan-dahang dumudulas\nAng kamay ko sa makinis mong braso, ooh\n\n@pre-chorus 2\nSana noon pa man ay\nSinabi na sa iyo\nKahit hindi na uso ay\nIto lang ang alam ko\n\n@chorus\nMagkahawak ang ating kamay\nAt walang kamalay-malay\nNa tinuruan mo ang puso ko\nNa umibig na tunay\n\n@post-chorus\nLa-la-la-la, la-la\nLa-la, la-la-la\n\n@verse 3\nLumipas ang maraming taon\n\'Di na tayo nagkita\nBalita ko\'y may anak ka na\nNgunit walang asawa\nTagahugas ka raw\nNg pinggan sa may Ermita\nAt isang gabi\'y nasagasaan\nSa isang madilim na eskinita, ha\n\n@pre-chorus 3\nLahat ng pangarap ko\'y bigla lang natunaw\nSa panaginip na lang pala kita maisasayaw\n\n@chorus\nMagkahawak ang ating kamay\nAt walang kamalay-malay\nNa tinuruan mo ang puso ko\nNa umibig na tunay\nMagkahawak ang ating kamay\nAt walang kamalay-malay\nNa tinuruan mo ang puso ko\nNa umibig na tunay\n\n@post-chorus\nLa-la-la-la, la-la\nLa-la, la-la-la\nLa-la-la-la, la-la\nLa-la, la-la-la', 1, 1, 1, '2024-10-31 11:13:29', '2024-11-02 04:58:23', 'tl'),
