(6608, 838, '@intro\nOh, no, no, no, no, no, no\n\n@verse\nKung bibitaw nang mahinahon, ako ba\'y lulubayan ng ating\nMga kahapon na \'di na kayang ayusin ng lambing?\nMga pangako ba\'y sapat na upang muli tayong\nIpagtagpo ng hinaharap?\n\n@pre-chorus\nBa\'t pa ipapaalala?\n\'Di rin naman panghahawakan\nBa\'t pa ipipilit\nKung \'di naman (kung \'di naman) tayo ang\n\n@chorus\nPara sa isa\'t isa?\n\'Di ba, sinta, tayong dalawa lang noon\nPara sa isa\'t isa? Oh, whoa\nBa\'t \'di sumang-ayon sa atin ang panahon?\n\n@verse\nSiguro nga\'y wala nang natira sa mga sinulat mo na para sa \'kin\nAlam kong luha ang bumubura ngunit hayaan mo na lang\nWalang saysay ang panalangin ko kung \'di ako ang hahanapin mo\nKahit sigaw pa ang pagsamo ko sa \'yo, bakit \'di mo dama \'to?\n\n@pre-chorus\nBa\'t pa ipapaalala?\n\'Di rin naman panghahawakan\nBa\'t pa ipipilit\nKung \'di naman (kung \'di naman) tayo ang\n\n@chorus\nPara sa isa\'t isa?\n\'Di ba, sinta, tayong dalawa lang noon\nPara sa isa\'t isa? Oh, whoa\nBa\'t \'di sumang-ayon sa atin ang panahon?\n\n@chorus\nPara sa isa\'t isa (sa isa\'t isa)\n\'Di ba, sinta, tayong dalawa lang noon (tayo, tayo)\nPara sa isa\'t isa? Oh, whoa\nBa\'t \'di sumang-ayon sa atin ang panahon?', 1, 1, 1, '2024-11-19 13:10:26', '2024-11-19 13:10:26', 'tl'),
(6609, 1420, '@verse\nNatapos na ang lahat\nNandito pa rin ako\nHetong nakatulala\nSa mundo, sa mundo\n\n@verse\nHindi mo maiisip\nHindi mo makikita\nAng mga pangarap ko\nPara sa \'yo, para sa \'yo\n\n@chorus\nOh\nHindi ko maisip kung wala ka\nOh\nSa buhay ko\n\n@verse\nNariyan ka pa ba?\nHindi ka na matanaw\nKung mayro\'n bang daraanang\nPasulong, pasulong\n\n@chorus\nOh\nHindi ko maisip kung wala ka\nOh\nSa buhay ko\n\n@instrumental\n\n@bridge\nSundan mo\nAng paghimig na lulan na aking pinagtatanto\nSundan mo\nAng paghimig ko\n\n@chorus\nOh\nHindi ko maisip kung wala ka\nOh\nSa buhay ko', 1, 1, 1, '2024-11-19 19:30:18', '2024-11-19 19:30:18', 'tl'),
