(6687, 6669, '@verse\nFallin\' out, fallin\' in\nNothing\'s sure in this world, no, no\nBreakin\' out, breakin\' in\nNever knowin\' what lies ahead\nWe can really never tell it all, no, no, no\n\n@verse\nSay \"Goodbye\", say \"Hello\"\nTo a lover or friend\nSometimes, we never could understand\nWhy some things begin, then just end\nWe can really never tell it all, no, no, no\n\n@pre-chorus\nBut, oh, can\'t you see\nThat no matter what happens, life goes on and on?\nAnd so, oh baby, just smile\n\'Cause I\'m always around you\nAnd I\'ll make you see how beautiful life is for you and me\n\n@chorus\nTake a little time, baby\nSee the butterflies\' colors\nListen to the birds that were sent\nTo sing for me and you\nCan you feel me?\nThis is such a wonderful place to be\n\n@chorus\nEven if there is pain now\nEverything would be alright\nFor as long as the world still turns\nThere will be night and day\nCan you hear me?\nThere\'s a rainbow always after the rain\n\n@hook\nOh, whoa\n\n@verse\nHittin\' high, hittin\' low\nWin or lose, you should go, yeah, yeah\nGettin\' warm, gettin\' cold\nWeather could be so good or bad\nBut, baby, this is life now, don\'t get mad, no, no, no\n\n@pre-chorus\n\'Cause, oh, can\'t you see (can\'t you see?)\nThat no matter what happens, life goes on and on?\nSo, baby, please smile (just smile)\n\'Cause I\'m always around you\nAnd I\'ll make you see how beautiful life is for you and me\n\n@chorus\nTake a little time, baby\nSee the butterflies\' colors\nListen to the birds that were sent\nTo sing for me and you\nCan you feel me?\nThis is such a wonderful place to be\n\n@chorus\nEven if there is pain now\nEverything would be alright\nFor as long as the world still turns\nThere will be night and day\nCan you hear me?\nThere\'s a rainbow always after the rain\n\n@bridge\nLife\'s full of challenges\nNot all the time we get what we want\nBut don\'t despair, my dear (I know now)\nYou\'ll take each trial, and you\'ll make it through the storm\n\'Cause you\'re strong, my faith in you is clear\nSo, I\'ll say once again, this world\'s wonderful\nAnd let us celebrate life that\'s so beautiful, so beautiful\n\n@chorus\nTake a little time, baby\nSee the butterflies\' colors\nListen to the birds that were sent\nTo sing for me and you\nCan you feel me?\nThis is such a wonderful place to be\n\n@chorus\nEven if there is pain now\nEverything would be alright\nFor as long as the world still turns\nThere will be night and day\nCan you hear me?\nThere\'s a rainbow always after the rain', 1, 1, 1, '2024-11-19 20:05:58', '2024-11-19 20:08:51', 'en'),
